import {Container} from 'react-bootstrap'
import React, { useEffect } from 'react';
import {useHistory} from 'react-router-dom'
import SolicitationSearchBar from './SolicitationSearchBar'
const Solicitation = () => {
    const history = useHistory();
    // Check if localstorage is set or not. If not set than redirect to the home page
    useEffect(() => {
        document.title = 'Solicitation';
        const storedData = JSON.parse(localStorage.getItem("MyUser"));
        if (!storedData._id) {
            history.push("/");
        }
    }, [])   // eslint-disable-line react-hooks/exhaustive-deps

    return (
        <>
            <Container className="maindivmargin">

            <div style={{height:'40px', marginTop: '-12px'}}>
                        <div style={{ float: 'left' }}>
                            <h3>Solicitation Search</h3>
                        </div>

                        <div style={{ float: 'right' }}>
                        <img src={formstate.statustext} style={{width: '65px', cursor:'pointer'}} onClick={() => { setFormstate({ ...formstate, status: myval, statustext: text }) }} />
                        
                        </div>
                    </div>

                <SolicitationSearchBar />

            </Container>
        </>
    )
}

export default Solicitation;
